(8, 1, '2019-01-31 10:42:48', '2019-01-31 10:42:48', '<h2>LOVE WHAT YOU DO</h2>\nCreate a website to start your own business so that you can really love what you do\n\n<a href=\"/about\" role=\"button\">\njoin the next tour\n</a>\n<h3>Try it Yourself</h3>\nWhat makes design&nbsp;so alluring? We&nbsp;believes the answer is designers. That\'s why we have made&nbsp;our entire focus on you - the designer. Your style, your ideas, your creativity.&nbsp;Go on -&nbsp;Try, share and design now!\n\n<a href=\"#\" role=\"button\">\nGet Started\n</a>\n<img width=\"776\" height=\"650\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma.png 776w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma-300x251.png 300w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma-768x643.png 768w\" sizes=\"(max-width: 776px) 100vw, 776px\">\n\nIf you feel lost, disappointed, hesitant, or weak, return to yourself, to who you are, here and now and when you get there, you will discover yourself, like a lotus flower in full bloom, even in a muddy pond, beautiful and strong.\n<h4> Masaru Emoto</h4>\n<h3>Hello.</h3>\nI love you, won\'t you tell me your name? These immortal words by legendary musician Jim Morrison are still as relevant today, in this digital age, as they were back then.&nbsp;\n\n<a href=\"#\" role=\"button\">\nLet\'s Meet\n</a>\nhttps://www.youtube.com/watch?v=XHOmBV4js_E\n<h3>Wordpress, made simple.</h3>\nEveryone can write, but not everyone is a writer. What makes the difference is the keen eye for detail and beauty.\n\n<a href=\"/about\" role=\"button\">\njoin the next tour\n</a>', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2019-01-31 13:40:13', '2019-01-31 13:40:13', '', 0, 'http://localhost:8888/wordpress/?page_id=8', 0, 'page', '', 0),
