(45, 1, '2019-01-31 11:59:52', '2019-01-31 11:59:52', '<h3>Writing, made simple.</h3>		\n		Everyone can write, but not everyone is a writer. What makes the difference is the keen eye for detail and beauty.		\n										<img width=\"1602\" height=\"900\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png 1602w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-300x169.png 300w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-768x431.png 768w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-1024x575.png 1024w\" sizes=\"(max-width: 1602px) 100vw, 1602px\" />', 'Q3  Hero Video Top Text Bottom Image', '', 'publish', 'closed', 'closed', '', 'q3-hero-video-top-text-bottom-image', '', '', '2019-01-31 11:59:52', '2019-01-31 11:59:52', '', 0, 'http://localhost:8888/wordpress/?elementor_library=q3-hero-video-top-text-bottom-image', 0, 'elementor_library', '', 0),
