(47, 1, '2019-01-31 11:59:52', '2019-01-31 11:59:52', '<h3>Writing, made simple.</h3>		\n		Everyone can write, but not everyone is a writer. What makes the difference is the keen eye for detail and beauty.		\n										<img width=\"1602\" height=\"900\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png 1602w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-300x169.png 300w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-768x431.png 768w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-1024x575.png 1024w\" sizes=\"(max-width: 1602px) 100vw, 1602px\" />', 'Q3  Hero Video Top Text Bottom Image', '', 'inherit', 'closed', 'closed', '', '45-revision-v1', '', '', '2019-01-31 11:59:52', '2019-01-31 11:59:52', '', 45, 'http://localhost:8888/wordpress/45-revision-v1/', 0, 'revision', '', 0),
(48, 1, '2019-01-31 12:27:25', '2019-01-31 12:27:25', '<!-- wp:paragraph -->\n<p>This is the innovative way of creation :)</p>\n<!-- /wp:paragraph -->		\n				<p>\n					BikeTour\n				</p>\n				<p></p>\n			<h2>Join our nature &amp; urban bicycle adventures</h2>		\n			<p>BikeTour offers the most interactive activity you can experience in urban and natural surroundings. Find out how the real city comes alive when you are guided by the right person</p>		\n			<a href=\"#\" role=\"button\">\n						join the next tour\n					</a>\n			<h3>Try it Yourself</h3>		\n		<p>What makes designso alluring? Webelieves the answer is designers. That\'s why we have madeour entire focus on you - the designer. Your style, your ideas, your creativity.Go on -Try, share and design now!</p>		\n			<a href=\"#\" role=\"button\">\n						Get Started\n					</a>\n										<img width=\"776\" height=\"650\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma.png 776w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma-300x251.png 300w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/ma-768x643.png 768w\" sizes=\"(max-width: 776px) 100vw, 776px\" />											\n		<p>If you feel lost, disappointed, hesitant, or weak, return to yourself, to who you are, here and now and when you get there, you will discover yourself, like a lotus flower in full bloom, even in a muddy pond, beautiful and strong.</p>		\n			<h4> Masaru Emoto</h4>		\n			<h3>Hello.</h3>		\n		<p>I love you, won\'t you tell me your name? These immortal words by legendary musician Jim Morrison are still as relevant today, in this digital age, as they were back then.</p>		\n			<a href=\"#\" role=\"button\">\n						Let\'s Meet\n					</a>\n		https://www.youtube.com/watch?v=XHOmBV4js_E		\n			<h3>Writing, made simple.</h3>		\n		Everyone can write, but not everyone is a writer. What makes the difference is the keen eye for detail and beauty.		\n										<img width=\"1602\" height=\"900\" src=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png\" alt=\"\" srcset=\"http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2.png 1602w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-300x169.png 300w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-768x431.png 768w, http://localhost:8888/wordpress/wp-content/uploads/2019/01/Mackbook2-1024x575.png 1024w\" sizes=\"(max-width: 1602px) 100vw, 1602px\" />', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2019-01-31 12:27:25', '2019-01-31 12:27:25', '', 8, 'http://localhost:8888/wordpress/8-revision-v1/', 0, 'revision', '', 0),
